import numpy as np

from agl.python.subgraph.subgraph import PySubGraph
from pyagl.pyagl import AGLDType, DenseFeatureSpec, SparseKVSpec, SparseKSpec, NodeSpec, EdgeSpec, SubGraph, NDArray

# node related spec
node_spec = NodeSpec("default", AGLDType.STR)
node_spec.AddSparseKSpec("node_feature", SparseKSpec("node_feature", 188047, AGLDType.INT64))
# edge related spec
edge_spec = EdgeSpec("default", node_spec, node_spec, AGLDType.STR)
edge_spec.AddSparseKSpec("edge_feature", SparseKSpec("edge_feature", 26, AGLDType.INT64))

sg = PySubGraph([node_spec], [edge_spec])

pb_string = [b""]
pb_string_double = [bytearray(pb_string[0])]
sg.from_pb_bytes(pb_string_double)

n_spk = sg.get_node_sparse_k_feature("default", "node_feature")
print(f"node feature: {n_spk} ")

e_spk = sg.get_edge_sparse_k_feature("default", "edge_feature")

print(f"edge_feature: {e_spk}")